import React, { useEffect } from 'react'
import Header from './components/Header'

const Login = () => {
  useEffect(()=>{
    if(localStorage.getItem('student-user-info'))
    history("/")
  },[]);
  
  return (
    <div>
        <Header />
        <div className="container">
            <br></br>
            <h1 className='text-center'>login</h1>
            <br></br>
            <div className='col-sm-6 offset-3'>
            <input type="email" placeholder='User Name or Email' className='form-control' />
            <br></br>
            <input type="password" placeholder='Your Password' className='form-control' />
            <br></br>
            <button className='btn btn-success text-light'>Login</button>
            </div>
        </div>
    </div>
  )
}

export default Login
